import {useState} from "react";


export const Form = () => {
    const [username, setUsername] = useState('')
    return (

        <form action="">
            <div className={'MyForm'}>
                <label>Username</label>
                <input type="text" value={username}
                       onChange={(event) => {
                           setUsername(event.target.value)
                       }}/>
                <button type={"submit"}>Submit</button>
            </div>
        </form>

    )
}
